export const todos = JSON.parse(localStorage.getItem("todos")) || [
    {
      id: 0,
      title: "purchase milk",
      completed: false,
      important: false
    },
    {
      id: 1,
      title: "going school for exam",
      completed: true,
      important: false
    },
    {
      id: 2,
      title: "clean room",
      completed: false,
      important: true
    }
  ];
